import React from "react";
import logo from "../assets/images/logo512.png"
import close from "../assets/images/close_img.png"
import "./header.css"
function Header() {
    return (
        <div className="Header">
            <div className="logo"><a href="https://reactjs.org/" target={"_blank"}><img src= {logo} alt="image"/></a></div>
            <div className="name"><a href="https://reactjs.org/" target={"_blank"}><h2><strong>React</strong></h2></a></div>
            <div className="close"><a href="#"><img src= {close} alt="image" /></a></div>
        </div>
        )
}
export default Header;
